function Add_Class(){this.navLink=$(".nav-link"),this.hasTreeView=$(".has-treeview")}Add_Class.prototype.listenClassEvent=function(n,s){location.href.split("?")[0]===n.href&&($(n).addClass(s),$(n).parents(".has-treeview").addClass("menu-open"),$(n).parents(".has-treeview").children(".nav-link").addClass("active"))},Add_Class.prototype.addActiveEvent=function(){var s=this;s.hasTreeView.each(function(){var n=$(this);s.listenClassEvent(n.find(".nav-link"),"active")}),s.navLink.each(function(){this.classList.contains("active")||s.listenClassEvent(this,"active")})},Add_Class.prototype.run=function(){this.addActiveEvent()},$(function(){(new Add_Class).run()});